    method: 'POST',
    baseURL: API + 'signin',
    data: {
      name: name,
      password: password
    }
  }).then((data) => {
    if (data.status === 203) {
      setNameError(true);
      this.setState({
        nameError: true,
        loading: false
      })
    } else {
      this.setState({
        loading: false
      })
      this.props.logIn(data.headers.authorization, this.state.name, data.data);
    }
  }).catch((err) => {
    this.setState({
      serverError: true,
      loading: false
